import React, {useState} from "react"

const LogInUserNames = [{name: "sami", email: "samxaloosi@gmail.com", password: "1234567" }]

 const LoginInitailValue = {
    LogInName: "",
    LogInEmail: "",
    LogInPassword: ""
 }

const disabled = true



export default function LogIn () {

    const [userLogin, setUserLogin] = useState(LoginInitailValue) 

    const onChange = (event) => {
        const {name, value} = event.target
        setUserLogin({...userLogin, [name]: value})
    }

    const onSubmit = (event) => {
        event.preventDefault()

    }

    return(
        <form>
           <label htmlFor="LogInName">
               Username: 
               <input
                    type= "text"
                    name="LogInName"
                    id="LogInName"
                    placeholder="Enter Your UserName"
                    value={userLogin.LogInName}
                    onChange={onChange}
                />
           </label>

           <label htmlFor="LogInEmail">
           Email:
               <input
                type="email"
                name="LogInEmail"
                id="LogInEmail"
                placeholder="Enter Your Email"
                value={userLogin.LogInEmail}
                onChange={onChange}
                />
           </label>

           <label htmlFor="LogInPassword">
           Password:
               <input
                    type="password"
                    name="LogInPassword"
                    id="LogInPassword"
                    placeholder="Enter Your Password"
                    value={userLogin.LogInPassword}
                    onChange={onChange}
                 />
           </label>



           <button disabled={disabled} >LogIn</button>
       </form>
    )
}
